import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1 className="h1">Hello, World!</h1>
        <button className="btn-info rounded">Button</button>
      </header>
    </div>
  );
}

export default App;
